import Header from '../components/Header';
import Layout from '../components/Layout';
import Footer from '../components/Footer';
import Link from 'next/link'

export default function Libraries() {
  return (
    <Layout>
      <Header/>
        <div>
        </div>
      <Footer/>
      <style jsx global>{`
        body {
          background: #F9F9F9;
          text-align: center;
          vertical-align: middle;
          text-align: center;
        }
      `}</style>
    </Layout>
  );
}
